import Card from "./Card.js"

function Tours(){
    return(
        <div>
            <div>
                <h2> Plan your Journey</h2>
            </div>

            <div>
                {
                    Tours.map( (tour) => {
                        return <Card {...tour} removeTour={removeTour()}>

                            </Card>
                    })
                }   
            </div>

        </div>
    )
}

export default Tours;
